import React from 'react';
import { List, Grid, Segment, Container, Header, Image } from 'semantic-ui-react'
import indra from '../Static/Images/indra.jpg'

const Footer = () => {

    return (
        <Segment vertical style={{ padding: '1em' }}>
            <div>
                <Segment textAlign='right'>  <Image src={indra} avatar style={{ fontSize: '2em' }} /></Segment>
                <Segment textAlign='left'>Left aligned content.</Segment>
                <Segment textAlign='center'>Center aligned content.</Segment>
            </div>
        </Segment>
    )
}

export default Footer;
